function extractFile(fileStr) {
    return { name: fileStr.split("/").pop(), webkitRelativePath: fileStr }
}

function extractFiles(listFiles) {
    let files = [];
    let lines = listFiles.split("\n");
    lines.forEach(element =>
        files.push(extractFile(element)));
    return files;
};

